import { Card, TextField, CardContent, Grid } from '@material-ui/core';
// // import TextField from '@mui/material/TextField';
// import Stack from '@mui/material/Stack';
// import { DatePicker } from '@material-ui/pickers';
import React, { useState } from 'react';
// // import SignUp from '../components/signup';

// const useStyles = makeStyles(theme => ({
// 	pageContent : {
// 		margin : theme.spacing(5),
// 		padding : theme.spacing(3)
// 	}
// }));
import { DatePicker } from '@material-ui/pickers';

export const Register = () => {
	// const classes = useStyles();
	const [date, setDate] = useState<Date | null>(null);
	return (
		<Card>
			<CardContent>
				<Grid container>
					<Grid item xs={12} sm={6}>
						<TextField 
							id="outlined-basic" 
							label="first name" 
							variant="outlined"
							// style={{ width : '80%' }}
							fullWidth
							margin = 'normal'
						/>
					</Grid>
					<Grid item xs={12} sm={6}>
						<TextField 
							id="outlined-basic" 
							label="Last name" 
							variant="outlined"
							// style={{ width : '80%' }}
							fullWidth
							margin = 'normal'
						/>
					</Grid>
					<Grid item xs={12}>
						<TextField 
							id="outlined-basic" 
							label="Email" 
							variant="outlined"
							fullWidth
							margin = 'normal'
						/>
					</Grid>
					<Grid item xs={12} sm={6}>
						<TextField 
							id="outlined-basic" 
							label="Profession" 
							variant="outlined"
							fullWidth
							margin = 'normal'
						/>
					</Grid>
					<Grid item xs={12} sm={6}>
						<TextField 
							id="outlined-basic" 
							label="Phone" 
							variant="outlined"
							fullWidth
							margin = 'normal'
						/>
					</Grid>
					<Grid item xs={12} sm={6}>
						<DatePicker 
							value={date}
							onChange={setDate}	
							autoOk
							inputVariant='outlined'
							emptyLabel=''
						/>
					</Grid>

				</Grid>
			</CardContent>
		</Card>
	);
};
